import React from "react";
import TMDBImage from "../TMDBImage/TMDBImage";

function MyListItem({ img, title }) {
  return (
    <li className="my-list-item">
      {title}
      <TMDBImage src={img} />
    </li>
  );
}

export default MyListItem;
